export default function CharitiesView() {

  const [charities, setCharities] = [];
  const {
    status,
    runAsync
  } = useAsync(AsyncState.Available)


  switch(status) {
    case AsyncState.Loading:
      return (
        <LoadingPage />
      )
  }

}
